reference:
Hosman vous propose ce superbe 3 pièces de 63,51 m² Carrez, situé Rue du Président Kruger à Courbevoie. Niché au 5ème et dernier étage, par escalier, d'un charmant immeuble, cet appartement traversant offre 70 m² de surface au sol, une lumière naturelle abondante grâce à son exposition sud-est.

Planifiez facilement votre visite en choisissant le créneau qui vous convient depuis le site d'Hosman.

L'appartement se compose comme suit :
- Belle pièce de vie de 35m2, mansardée avec poutres apparentes, orientée sud-est pour une luminosité optimale ;
- Cuisine ouverte et moderne avec bar, parfaite pour des moments conviviaux ;
- Deux chambres : une donnant sur cour pour un calme absolu, l'autre sur rue mais tout aussi paisible ;
- Salle de bain spacieuse avec douche, baignoire, double vasque et fenêtre avec aération VMC ;
- Toilettes séparées ;

Le système de chauffage et d'eau chaude est individuel au gaz.
La taxe foncière annuelle est de 480 €.

Le quartier est agréable et bien desservi par les transports en commun. Vous êtes à seulement 4 minutes à pied de la gare de Courbevoie, où passent les lignes de bus et de train. Les complexes sportifs, commerces et espaces verts environnants ajoutent au confort de vie.

Le bien est soumis au statut de copropriété. L'immeuble, dont le ravalement et l'isolation de la toiture ont été refaits en 2023, est en très bon état général. La copropriété est bien tenue et sécurisée. Les charges sont de 607 € par trimestre.

Hosman s'efforce de réinventer l'agence immobilière en offrant un service innovant et transparent aux acheteurs et aux vendeurs. Nos frais d'agence sont de 9 900 euros fixes à la charge du vendeur.

Si vous êtes un professionnel de l'immobilier, sachez que toutes les annonces Hosman sont ouvertes à la collaboration. N'hésitez pas à nous contacter pour en discuter.
